1e12ddb2a53?version=1.0&amp;t=1448356672546" />\n<h4 class="subtitle">Start</h4>\n\n<p class="welcome-text">Review our <a href="http://www.liferay.com/welcome-start?v1.0" target="_blank">Quick Start Guide</a> for an overview of Liferay's features.</p>\n\n<div class="helper-clearfix">&nbsp;</div>\n</div>\n\n<div class="welcome-content"><img class="welcome-icon" src="/documents/20182/0/welcome_learn/e4d3adb0-b0c2-449b-8ed3-59d2126fabaf?version=1.0&amp;t=1448356672963" />\n<h4 class="subtitle">Learn</h4>\n\n<p class="welcome-text">Read the official <a href="http://www.liferay.com/welcome-learn?v1.0" target="_blank">Liferay User Guide</a> for detailed information about setting up and configuring Liferay.</p>\n\n<div class="helper-clearfix">&nbsp;</div>\n</div>\n\n<div class="welcome-content"><img class="welcome-icon" src="/documents/20182/0/welcome_community/d6e02dcc-ee6d-47d3-8ecd-d7d0644818f4?version=1.0&amp;t=1448356672889" />\n<h4 class="subtitle">Engage</h4>\n\n<p class="welcome-text">Visit the <a href="http://www.liferay.com/welcome-engage?v1.0" target="_blank">Liferay Community</a> to post questions, find answers, and contribute.</p>\n\n<div class="helper-clearfix">&nbsp;</div>\n</div>\n\n<div class="welcome-content"><img class="welcome-icon" src="/documents/20182/0/welcome_tools/2949c9b4-6837-4a51-9782-03b394647b62?version=1.0&amp;t=1448356673112" />\n<h4 class="subtitle">Develop</h4>\n\n<p class="welcome-text">Explore our <a href="http://www.liferay.com/welcome-develop?v1.0" target="_blank">Developer Resources</a> to develop apps and more for Liferay Portal.</p>\n\n<div class="helper-clearfix">&nbsp;</div>\n</div>\n\n<div class="welcome-content"><img class="welcome-icon" src="/documents/20182/0/welcome_ee/ea3e6f75-72f0-4f45-8125-9dc825c82248?version=1.0&amp;t=1448356672810" />\n<h4 class="subtitle">Evaluate</h4>\n\n<p class="welcome-text">Learn more about partners, support, training and other <a href="http://www.liferay.com/welcome-evaluate?v1.0" target="_blank